import React from 'react'

import { GoogleGenAI } from "@google/genai";

const ai = new GoogleGenAI({ apiKey: "AIzaSyAiV_SF4k-qRDPTDPBVEFMQ9d8eM1KLjoU" });

const msg = document.getElementById('msg').ariaValueText;

async function main() {
  const response = await ai.models.generateContent({
    model: "gemini-2.0-flash",
    contents: msg,
  });
  console.log(response.text);
}



const Chatbox = () => {
  return (
    <div>
        <div className="container">
            <div class="row">
                <div class="box">
                    <div class="chat-body">
                        <div class="chat-message user"><span class="badge bg-primary">You:</span> Hello!</div>
                        <div class="chat-message bot"><span class="badge bg-secondary">Bot:</span> Hi there! How can I help?</div>
                    </div>
                    <div class="chat-footer d-flex">
                        <input type="text" class="form-control me-2" placeholder="Type your message..." id='msg'/>
                        <button class="btn btn-primary" onClick='main()'>Send</button>
                    </div>
                </div>
            </div>
        </div>
    </div>
  )
}

export default Chatbox
